import React, { useState } from "react";
import InputForm from "./InputForm";
import TotalCostTripForm from "./TotalCostTripForm";
export default function App() {
  const [vehicles, setVehicle] = useState([]);
  const [totalCostTrip, setTotalCostTrip] = useState({});
  console.log(vehicles)
  formula =(vehicle)=>{

    let tex = 20 +(vehicle.interchangeName.value * 0.2)
    console.log(tex)
  }
  return (
    <div class="container">
      <div class="row top30">
        <div class="col-5 border-add">
          <InputForm
            getVehicle={(vehicle) => {
              setVehicle([...vehicles, vehicle])
            }} />

        </div>
        <div class="col-1" />
        <div class="col-5 border-add">
          <InputForm
            exit
            vehicles={vehicles}
            getVehicle={(vehicle) => {
              console.log("vehicle",vehicle)
              formula(vehicle)
            }} />

        </div>
      </div>
      <div class="row top30">
        <div class="col">
          <TotalCostTripForm />
        </div>
      </div>
      <div class="row top30">
        <span>Total Vsehicles</span>

        {vehicles.map((item) => {
          return (
            <div class="col-2">
              <button
                className='button'
                type="submit"
              >
                <span>{item.numberPlate}</span>
              </button>
            </div>
          )
        })}
      </div>
    </div>
  );
}
